import React from "react";
import {Helmet} from "react-helmet";
import Config from "../Config.json";
import { Splide, SplideSlide } from '@splidejs/react-splide';

const TITLE = "Resources | " + Config.SITE_TITLE;
const DESC = "This is the resources page of the VIStA Research Group.";
const CANONICAL = Config.SITE_DOMAIN + "/resources";


class Resources extends React.Component{

    render() {
        return (<main>

            <Helmet>
                <title>{TITLE}</title>
                <link rel="canonical" href={CANONICAL} />
                <meta name="description" content={DESC}/>
                <meta name="theme-color" content={Config.THEME_COLOR} />
            </Helmet>

            <h3 className="resources-h3">Featured Talks</h3>

            <div id="splideArea">
                <Splide options={
                    {type     : 'loop',
                    gap: '2rem',
                    perPage: 3,
                    fixedHeight: '28rem',
                    focus    : 'center',
                    autoWidth: true,
                    }
                        } aria-label="Feature Talks">
                    <SplideSlide>
                       <img src="https://s2.loli.net/2022/05/30/im5jdgzfR2NhMJT.png" />
                    </SplideSlide>
                    <SplideSlide>
                      <img src="https://s2.loli.net/2022/05/30/VkldJfXewLA2IPO.png" />
                    </SplideSlide>
                    <SplideSlide>
                      <div id="resources-3"> Block 3 </div>
                    </SplideSlide>
                    <SplideSlide>
                      <img src="https://s2.loli.net/2022/05/30/kszx9fudq38AVYw.png" />
                    </SplideSlide>
                </Splide>
            </div>

        </main>);
    }
}

export default Resources;
